import React from "react";
import { useParams, Link } from "react-router-dom";

function Prod() {
  const { categoryName } = useParams();

 


  return (
    <div>
      <h2>Страница категории: {categoryName}</h2>
      <ul>
        {products.map((product) => (
          <li key={product.id}>
            <Link to={`/category/${categoryName}/${product.id}`}>
              {product.name}
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Prod;
